import styled from 'styled-components';

export const HeaderWrapped = styled.div`
    width = 100%;
    border: 1px solid blue;
    padding: 14px 0;
    background-color : #002B34;
    h1 {
        margin-left : 10px;
        color : #ffffff;
    }

`;
